import React from "react";
import NavBar from "./NavBar";


class Files extends React.Component{
    render(){
        return(
            <div className="container-fluid">
                <div className="wrapper-box">
                    <NavBar/>
                </div>
            </div>
        );

    }
}
export default Files;
